  input: '"TEXT","F3A","C00396200","Our committee is in receipt of the Commissions
    inquiry about our April quarterly report and this letter is in response.  We are
    aware of the best efforts standard established by the committee.  We do have a
    system in place to capture as much employer and occupation information as possible
    and we do meet the best efforts standard.  All of our original requests contain
    the required disclaimer.  If we do not receive the information with the initial
    contribution, we then follow up within 30 days, in writing, and we do not solicit
    more money.  This follow up contains a self addressed, stamped post card.  Finally,
    this amendment contains over 25 itemized contributors from our original report
    for which we have obtained the employer and occupation information.  We have mailed,
    via USPS, a copy of an original solicitation as well as our follow up request
    as examples.   We trust that this two part response will be sufficient.  If more
    information is required, please do not hesitate to contact us.  Thank you, Friends
    of Bobby Jindal."'
